import React, { Component } from "react";
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import image from '../../assets/images/banner.png';
import TweetDataService from "../../services/tweets_service.js"
import Map from './Map'
import Hashtags from './Hashtags'
import Topics from './Topics'
import Stats from './General Stats'

export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Tweets: [],
      currentTweet: null,
      currentIndex: -1,
      searchid: "",
      searchnome: "",
      searchemprego: ""
    };
  }

  componentDidMount() {
    this.retrieveTweet();
  }

  retrieveTweet() {
    TweetDataService.getAll()
      .then(response => {
        const tweets = response.data.map(item => {
          const tweet = item.tweet || {};
          return {
            ...item,
            nome: tweet.nome
          };
        });
        this.setState({
          Tweets: tweets
        });
        console.log(tweets);
      })
      .catch(e => {
        console.log(e);
      });
  }

  render() {
    return (
      <Navbar className="navbar navbar-expand-lg navbar-white bg-white">
        <Container fluid>
          <div className="row align-items-start">
            <div className="col-lg-4 col-md-6">
              <div className="mb-3">
                <h3 className="text-center">Topic Trends</h3>
                <Topics />
              </div>
              <div className="mb-3">
                <h3 className="text-center"># Hashtag Trends</h3>
                <Hashtags />
              </div>
            </div>
            <div className="col-lg-8 col-md-6">
              <div className="row">
                <div className="col-md-9">
                  <img src={image} className="img-fluid" alt="Banner" />
                </div>
                <div className="col-md-3">
                  <Stats />
                </div>
              </div>
              <div className="mt-3">
                <h2 className="text-center">Tweets per Country</h2>
                <Map />
              </div>
            </div>
          </div>
        </Container>
      </Navbar>
    );
  }
}
